import React from 'react';

const Card = React.forwardRef(({ id, name, email }) => {
  return (
    <div>
      <img src={`https://robohash.org/${id}?size=200x200`} alt='robots' />
      <div>
        <h2>{name}</h2>
        <p>{email}</p>
      </div>
    </div>
  );
});

export default Card;
